body { 
  margin: 16px; 
  font-family: Arial, sans-serif; 
  line-height: 1.6;
}
.test-grid {
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
  gap: 20px;
  margin: 20px 0;
}
.test-card {
  border: 1px solid #ddd;
  border-radius: 8px;
  padding: 15px;
  background: #f9f9f9;
}
.test-card h3 {
  margin-top: 0;
  color: #333;
}
.test-link {
  display: inline-block;
  background: #007acc;
  color: white;
  padding: 8px 16px;
  text-decoration: none;
  border-radius: 4px;
  margin-top: 10px;
}
.test-link:hover {
  background: #005999;
}
.feature-list {
  list-style-type: none;
  padding-left: 0;
}
.feature-list li {
  padding: 2px 0;
}
